import * as React from 'react';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import Dialog from '@mui/material/Dialog';
import DialogContent from '@mui/material/DialogContent';

// SelectLabelsDouble component
export function SelectLabelsDouble() {
    const [roomType, setRoomType] = React.useState('');
    const [guests] = React.useState(2); // Automatically set to 2 for double rooms
    const [error, setError] = React.useState(false);

    const handleRoomChange = (event) => {
        setRoomType(event.target.value);
        setError(false); // Reset error message when room type changes
    };

    const handleSubmit = async () => {
        if (!roomType) {
            setError(true);
        } else {
            setError(false);
            // Send room type and fixed guest number to the backend
            const response = await fetch("http://localhost:5000/api/booking/details", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                },
                body: JSON.stringify({ roomType, guests }),
            });

            const data = await response.json();
            if (response.ok) {
                console.log(`Booking details: Room Type: ${roomType}, Number of Guests: ${guests}`);
            } else {
                alert(data.message || 'Failed to submit the booking details');
            }
        }
    };

    return (
        <Box>
            <FormControl sx={{ m: 1, minWidth: 400 }}>
                <InputLabel id="room-type-label">Room Type</InputLabel>
                <Select
                    labelId="room-type-label"
                    id="room-type-select"
                    value={roomType}
                    label="Room Type"
                    onChange={handleRoomChange}
                >
                    <MenuItem value="">
                        <em></em>
                    </MenuItem>
                    <MenuItem value="doubleDuplex">Double Duplex Room</MenuItem>
                </Select>
                <FormHelperText>Choose your room type</FormHelperText>
            </FormControl>

            <Button onClick={handleSubmit} variant="contained" color="primary">
                Select
            </Button>
        </Box>
    );
}

// WovenImageListDouble component
export function WovenImageListDouble() {
    const [open, setOpen] = React.useState(false);
    const [selectedImage, setSelectedImage] = React.useState(null);

    const handleClickOpen = (img) => {
        setSelectedImage(img); // Set the clicked image
        setOpen(true);         // Open the dialog
    };

    const handleClose = () => {
        setOpen(false);        // Close the dialog
    };

    return (
        <div>
            {/* Image List */}
            <ImageList sx={{ width: 500, height: 450 }} variant="woven" cols={3} gap={8}>
                {itemData.map((item) => (
                    <ImageListItem key={item.img} onClick={() => handleClickOpen(item.img)}>
                        <img
                            srcSet={`${item.img}?w=161&fit=crop&auto=format&dpr=2 2x`}
                            src={`${item.img}?w=161&fit=crop&auto=format`}
                            alt={item.title}
                            loading="lazy"
                            style={{ cursor: 'pointer' }} // Indicate clickability
                        />
                    </ImageListItem>
                ))}
            </ImageList>

            {/* Dialog for Expanded Image */}
            <Dialog open={open} onClose={handleClose} maxWidth="lg">
                <DialogContent>
                    {selectedImage && (
                        <img
                            src={selectedImage}
                            alt="Expanded"
                            style={{ width: '100%', height: 'auto' }}
                        />
                    )}
                </DialogContent>
            </Dialog>
        </div>
    );
}

// Data for the Image List
const itemData = [
    { img: '/roomimages/bathroom.jpg', title: 'Bed' },
    { img: '/roomimages/room2.jpg', title: 'Sink' },
    { img: '/roomimages/room3.jpg', title: 'Books' },
    { img: '/roomimages/kitchen.jpg', title: 'Chairs' },
    { img: '/roomimages/kitchen2.jpg', title: 'Candle' },
    { img: '/roomimages/livingroom.jpg', title: 'Laptop' },
    { img: '/roomimages/room4.jpg', title: 'Doors' },
    { img: '/roomimages/livingroom2.jpg', title: 'Coffee' },
    { img: '/roomimages/livingroom3.jpg', title: 'Storage' },
    { img: '/roomimages/building.jpg', title: 'Coffee table' },
    { img: '/roomimages/view.jpg', title: 'Blinds' },
];
